        // 此结点为叶结点
        if(root->left==nullptr&&root->right==nullptr){
          return nullptr;
        }
        // 此结点只有一个结点
        if(root->left==nullptr){
          return root->right;
        }
        if(root->right==nullptr){
          return root->left;
        }
        // 此结点有两个结点
        // 将右子树放在左子树的最大值的右子树位置
        TreeNode* node = root->left;
