解法二 : 递归找到要删除的结点 , 与该结点所在的子树的最大值或最小值交换后删除

这个比较难理解 , 很绕 , 但是leetcode 官方是这个解法 , 也许减少删除后对二叉搜索树平衡的破坏
if 该结点是叶结点直接返回空
if 该结点的左子树不空,就找到以该结点为根的树的最大值max
​    将 max 赋值给结点后删除值为 max的结点
else if 如果该结点的右子树子树不空,就找到以该结点为根的树的最大值max
​    将 min 赋值给结点后删除值为 min 的结点


/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution
{
public:
    TreeNode *deleteNode(TreeNode *root, int key)
    {
    if(root==nullptr)
      return root;
    TreeNode* node = root;
    if(root->val == key){
      // 找到结点后
      // 是叶结点 , 直接删除 , 返回 nullptr
      if(node->left==nullptr&&node->right==nullptr)
        return nullptr;
      // 左子树不空
      if(node->left!=nullptr){
        node->val = findTreeMax(node);
        node->left = deleteNode(node->left, node->val);
        return node;
        // 右子树不空
      }else{ 
        node->val = findTreeMin(node);
        node->right = deleteNode(node->right, node->val);
        return node;
      }
    } else if(key > node->val){
      node->right = deleteNode(node->right,key);
    }else{
      node->left = deleteNode(node->left, key);
    }
    return root;
  }
  // 查找右子树里最小的
  int findTreeMin(TreeNode* root){
    root=root->right;
    while(root->left!=nullptr)
      root=root->left;
    return root->val;
  }
  // 查找左子树里最大的
  int findTreeMax(TreeNode* root){
    root=root->left;
    while(root->right!=nullptr)
      root=root->right;
    return root->val;
  }
};

解法三 : 迭代找到要删除的的结点直接删除 , 然后处理父结点和左右子树的问题

迭代真的麻烦 
需要记录该结点的父结点以及该结点是父结点的左子结点还是右子结点
还要考虑如何把子树接到父结点问题


/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution
{
public:
    TreeNode *deleteNode(TreeNode *root, int key)
    {
        TreeNode* pre = root;
        TreeNode* node = root;
        TreeNode* result = root;
        int leftOrRight = -1;
        // 找到当前节点
        while (node != nullptr)
        {
            if(node->val == key){
                break;
            } else if(key > node->val){
                leftOrRight = 1;
                pre = node;
                node = node->right;
            }else{
                leftOrRight = 0;
                pre = node;
                node = node->left;
            }
        }
    //printf("val =%d ",node->val);
    // 数字不存在
    if(node==nullptr)
      return root;
    // 找到数字后将其删除
    // 是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    // 不是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    TreeNode* l=node->left;
    TreeNode* r=node->right;

    if(node==root){
      if(l==nullptr&&r==nullptr)
        return nullptr;
      if(l==nullptr)
        return r; 
      if(r==nullptr)
        return l;
      TreeNode* newRoot=l;
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      return newRoot;
    } else {
      if(l==nullptr&&r==nullptr){

        if(leftOrRight==0){
          pre->left=nullptr;
        }
        if(leftOrRight==1){
          pre->right=nullptr;
        }

        return root;
      }
      if(l==nullptr){
        if(leftOrRight==0){
          pre->left=r;
        } else {
          pre->right=r;
        }
        return root;
      }
      if(r==nullptr){
        if(leftOrRight==0){
          pre->left=l;
        } else {
          pre->right=l;
        }
      return root;
      }
      // 直接将左子树接上去,右子树放到左子树的最大键值的右子树
      if(leftOrRight==0){
        pre->left=l;
      } else {
        pre->right=l;
      }
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      //printf("new l val = %d ",l->val);

        return root;
    }

  }
};

