然后每次递归调用开始的时候置走到的 board[][] 字母为 0
结束时把 word 对应的字母赋给 board[][]

原本使用类间变量 key 来记录走到了 word 哪一个字母, 这样每次都要加一减一, 太麻烦, 把 key 当做参数传进去, 然后每次都+1 递归


import java.util.HashMap;

class Solution {
  public boolean exist(char[][] board, String word) {
    char[] charsWord = word.toCharArray();
    for(int y=0; y=board.length || x=board[0].length || board[y][x] != word[key]){
      return false;
    }
    if(key == word.length-1){
      return true;
    }
    board[y][x] = '\0';

    boolean res = ( dfs(board, word, x, y-1, key+1) || dfs(board, word, x, y+1, key+1) || dfs(board, word, x-1, y, key+1) || dfs(board, word, x+1, y, key+1) );

    if(res){
      return true;
    }else{
      board[y][x] = word[key];
      return false;
    }
  }
}

