解法一 动态规划
class Solution {
    public int cuttingRope(int n) {
      int[] dp = new int[n+1];
      dp[1] = 1;
      for(int l = 2; li ? dp[i] : i;
          int right = dp[l-i]>l-i ? dp[l-i] : l-i;
          int res = left*right;
          if(res>dp[l]){
            dp[l] = res;
          } 
        }
      }
      return dp[n];
    }
}

