class Solution {
  public int findNthDigit(int n) {
    if(n sum) {
      long newColumnSum = (i + 1) * ten * 9;
      if (sum + newColumnSum > (long)n+1) {
        break;
      }
      sum +=newColumnSum;
      i++;
      ten *= 10;
    }
    if(n+1==sum){
      return 9;
    }
    long number = ten + (n - sum) / (i+1);
    int digit = i-(n - (int)sum) % (i+1);
    // 把数字 number 的第 digit 位返回
    int res = 0;
    while (digit != -1) {
      res = (int)(number % 10);
      number = number / 10;
      digit--;
    }
    return res;
  }
}

