class Solution {
    public int maxDepth(TreeNode root) {
      if(root==null){
        return 0;
      }
      int leftMaxDepth = maxDepth(root.left);
      int rightMaxDepth = maxDepth(root.right);
      return leftMaxDepth>rightMaxDepth ? leftMaxDepth+1 : rightMaxDepth+1;
    }
}

