题解区有用动态规划写的, 代码差不多, 但是我感觉这道题用动态规划有点强求,  递推方程有点难求

本来我用的是双指针, 这道题不用也是可以的, 因为要求的是最大利润不是具体哪一天买和卖
用双指针就出现了边界问题, 还是写的不够熟练

class Solution {
  public int maxProfit(int[] prices) {
    if(prices.length==0){
      return 0;
    }
    int min = prices[0];
    int maxProfit = 0;
    for(int i =0; imaxProfit){
        maxProfit = prices[i]-min;
      }
    }
    return maxProfit;
  }
}

